import logo from './logo.svg';
import {Canvas} from "@react-three/fiber";
import './App.css';
import Lobby from './components/lobby/lobby';
import { Suspense } from 'react';

function App() {
  return (
    <Suspense>
    <div className="App">
      <Canvas shadow>
          <Lobby/>
      </Canvas>
    </div>
    </Suspense>
  );
}

export default App;
